import Avatar from './avatar';
function UserInfo(props){
    return (
        <div className="UserInfo">
            <Avatar src={props.author.avatarUrl} name={props.author.name}/>
            <div className="UserInfo-name">
              {props.author.name}
            </div>
          </div>
    )
}
export default UserInfo ;
